// File: THICC_STAKING.sol


pragma solidity ^0.8.4;






contract THICC_STAKING is ERC721Holder, Ownable {

    IERC721 private thiccNFT;
    IERC20 private thiccToken;

    struct StakingDetails {
        uint16 tokenId;
        bool isStaked;
        uint256 claimableTokens;
        uint256 tokensEarned;
        uint256 stakedDays;
    }

    string public name = 'Thicc Frens Staking Contract';

    mapping(uint16 => address) public tokenOwnerOf;
    mapping(uint16 => uint256) public tokenStakedAt;

    // Currently staked tokenIds of user
    mapping(address => uint16[]) public tokenIdsOfUser;

    // Total tokens earned by the user. wallet address => tokenId => amount
    mapping(address => mapping(uint16 => uint256)) public totalTokensEarned;

    uint8[] public rarityRatingArray; // Index 0 is 0

    uint256 _decimals = 9; // From Thicc Frens Token contract

    uint256[4] public EMISSION_RATE_PER_HOUR = [0, 1666666666666, 2500 * 10 ** _decimals, 4166666666666];

    // days => multiplier
    mapping(uint16 => uint16) public rewardMultipliers;
    uint8 rewardMultiplierDecimal = 10;


    uint256 MINIMUM_STAKING_PERIOD = 1 days;
    uint256 STAKING_TIME_RESOLUTION = 1 hours;

    constructor(address _nftContractAddress, address _tokenContractAddress, uint8[556] memory _rarityRating) {

    thiccNFT = IERC721(_nftContractAddress);
    thiccToken = IERC20(_tokenContractAddress);

    rewardMultipliers[14] = 25;
    rewardMultipliers[30] = 70;

    rarityRatingArray = _rarityRating;

    }

    function changeEmissionRate(uint256[4] memory newEmissionRate) external onlyOwner() {
        EMISSION_RATE_PER_HOUR = newEmissionRate;
    } 

    function changeRewardMultipliers(uint16 dayIndex, uint16 newValue) external onlyOwner() {
        rewardMultipliers[dayIndex] = newValue;
    }

    function getLenghtOfRarityRatingArray() external view onlyOwner() returns(uint256) {
        return rarityRatingArray.length;
    }

    function deleteRarityRatingArray() external onlyOwner() {
        delete rarityRatingArray;
    }

    function addRarityRatingData(uint8[] memory _rarityRating) external onlyOwner() {
        for (uint16 i = 0; i < _rarityRating.length; i++) {
            rarityRatingArray.push(_rarityRating[i]);
        }
    }
    
    // Transfer Thicc token on unstake
    function transferThiccToken(uint256 amount) public {
         if (amount > 0) {
            require(thiccToken.balanceOf(address(this)) >= amount, 'Not enough Thicc tokens to transfer.');
            require(thiccToken.transfer(msg.sender, amount), 'Thicc token transfer failed');
        }
    }

    // Thicc balance held by this contract
    function thiccTokenBalance() public view onlyOwner() returns(uint256) {
        return thiccToken.balanceOf(address(this));
    }

    // Get all tokenIds staked by a particular user
    function getAllStakedByUser() public view returns(uint16[] memory) {
       return tokenIdsOfUser[msg.sender];
    }

    // Get details about NFT tokenIds
    function getStakingDetailsOfUser(uint16[] memory tokenIds) external view returns(StakingDetails[] memory) {
        // NFTs staked by user previously
        uint16[] memory allUserStakedTokenIds = getAllStakedByUser();

        StakingDetails[] memory stakingDetails = new StakingDetails[](tokenIds.length+allUserStakedTokenIds.length);
        
        uint16 index = 0;

        // allUserStakedTokenIds - these are staked by user
        for (uint16 i = 0; i < allUserStakedTokenIds.length; i++) {
            uint16 tokenId = allUserStakedTokenIds[i];
            bool isStaked = true;
            uint256 claimableTokens = calculateClaimableTokens(tokenId);
            uint256 tokensEarned = totalTokensEarned[msg.sender][tokenId];
            uint256 stakedDays = (block.timestamp - tokenStakedAt[tokenId]) / 1 days;
            stakingDetails[index] = StakingDetails(tokenId, isStaked, claimableTokens, tokensEarned, stakedDays);
            index++;
        }

        // These are not staked by user yet - but could have been staked previously
        for (uint16 i = 0; i < tokenIds.length; i++) {
            uint16 tokenId = tokenIds[i];
            bool isStaked = false;
            uint256 claimableTokens = 0;
            uint256 tokensEarned = totalTokensEarned[msg.sender][tokenId];
            uint256 stakedDays = 0;
            stakingDetails[index] = StakingDetails(tokenId, isStaked, claimableTokens, tokensEarned, stakedDays);
            index++;
        }
        return stakingDetails;
    }

    // Withdraw the remaining Thicc tokens from this contract to the owner's address
    function withdrawThiccTokens() external onlyOwner() {
        require(thiccToken.balanceOf(address(this)) > 0, 'Not enough Thicc tokens to withdraw.');
        require(thiccToken.transfer(msg.sender, thiccToken.balanceOf(address(this))), 'Thicc token transfer failed');
    }

    function stake(uint16[] memory tokenIds) external {

        // console.log()

        for (uint16 i = 0; i < tokenIds.length; i++) {
            thiccNFT.safeTransferFrom(msg.sender, address(this), tokenIds[i]);
            tokenOwnerOf[tokenIds[i]] = msg.sender; 
            tokenStakedAt[tokenIds[i]] = block.timestamp;

            tokenIdsOfUser[msg.sender].push(tokenIds[i]);
        }
        
    }

    // Number of tokens a user can claim
    function calculateClaimableTokens(uint16 tokenId) public view returns(uint256) {

        // require(tokenOwnerOf[tokenId] != address(0), "NFT not staked.");
        // If it is not currently staked return 0
        if (tokenOwnerOf[tokenId] == address(0)) {
            return 0;
        }

        uint256 timeStaked = block.timestamp - tokenStakedAt[tokenId];

        // No tokens if staked for less than a day; Then reward at every hour.
        if (timeStaked < MINIMUM_STAKING_PERIOD) {
            // No reward
            return 0;
        } else {

            uint256 first13DaysRewardRatePerHour = EMISSION_RATE_PER_HOUR[rarityRatingArray[tokenId]];
            uint256 atAfter14Before29DaysRewardRatePerHour = (EMISSION_RATE_PER_HOUR[rarityRatingArray[tokenId]] * rewardMultipliers[14]) / rewardMultiplierDecimal;
            uint256 atAfter30DaysRewardRatePerHour = (EMISSION_RATE_PER_HOUR[rarityRatingArray[tokenId]] * rewardMultipliers[30]) / rewardMultiplierDecimal;

            if (timeStaked >= 30 days) {

                uint256 first13DaysReward = (14 days / STAKING_TIME_RESOLUTION) * first13DaysRewardRatePerHour;
                uint256 atAfter14Before29Reward = ((30 days - 14 days) / STAKING_TIME_RESOLUTION) * atAfter14Before29DaysRewardRatePerHour;
                uint256 atAfter30DaysReward = ((timeStaked - 30 days) / STAKING_TIME_RESOLUTION) * atAfter30DaysRewardRatePerHour;

                return first13DaysReward + atAfter14Before29Reward + atAfter30DaysReward;

            } else if (timeStaked >= 14 days) {
                
                // In hours
                uint256 first13DaysReward = (14 days / STAKING_TIME_RESOLUTION) * first13DaysRewardRatePerHour;

                uint256 atAfter14Before29Reward = ((timeStaked - 14 days) / STAKING_TIME_RESOLUTION) * atAfter14Before29DaysRewardRatePerHour;
                return first13DaysReward+atAfter14Before29Reward ;
            } else {
                uint256 totalEarned = (timeStaked / STAKING_TIME_RESOLUTION) * first13DaysRewardRatePerHour;
                return totalEarned ;
            }

        }
    }

    function unstake(uint16[] memory tokenIds) external {

        for (uint16 i = 0; i < tokenIds.length; i++) {

            // If not token owner raise error and revert
            require(tokenOwnerOf[tokenIds[i]] == msg.sender, 'Not owner.');

            uint256 tokensEarned = calculateClaimableTokens(tokenIds[i]);

            thiccNFT.safeTransferFrom(address(this), msg.sender, tokenIds[i]);
            transferThiccToken(tokensEarned);

            totalTokensEarned[msg.sender][tokenIds[i]] += tokensEarned;

            uint256 arrLength = tokenIdsOfUser[msg.sender].length;
            uint16[] memory newTokenArr = new uint16[](arrLength - 1);
            uint16 index = 0;

            for (uint16 j = 0; j < arrLength; j++) {
                if (tokenIdsOfUser[msg.sender][j] != tokenIds[i]) {
                    newTokenArr[index] = tokenIdsOfUser[msg.sender][j];
                    index++;
                }
            }

            tokenIdsOfUser[msg.sender] = newTokenArr;

            delete tokenOwnerOf[tokenIds[i]];
            delete tokenStakedAt[tokenIds[i]];

        }
    }

}
